function DriveCar () {
    if (controller.A.isPressed() && GamePlaying == 1) {
        if (Direction == 1) {
            if (Marlio.vx <= Max_Speed * -1) {
                Marlio.ax = 0
                Marlio.ay = Marlio.vy * Drift_Speed
            } else {
                Marlio.ax = Acceleration_Speed * -1
                Marlio.ay = Marlio.vy * Drift_Speed
            }
        }
        if (Direction == 2) {
            if (Marlio.vy <= Max_Speed * -1) {
                Marlio.ax = Marlio.vx * Drift_Speed
                Marlio.ay = 0
            } else {
                Marlio.ax = Marlio.vx * Drift_Speed
                Marlio.ay = Acceleration_Speed * -1
            }
        }
        if (Direction == 3) {
            if (Marlio.vx >= Max_Speed * 1) {
                Marlio.ax = 0
                Marlio.ay = Marlio.vy * Drift_Speed
            } else {
                Marlio.ax = Acceleration_Speed * 1
                Marlio.ay = Marlio.vy * Drift_Speed
            }
        }
        if (Direction == 4) {
            if (Marlio.vy >= Max_Speed * 1) {
                Marlio.ax = Marlio.vx * Drift_Speed
                Marlio.ay = 0
            } else {
                Marlio.ax = Marlio.vx * Drift_Speed
                Marlio.ay = Acceleration_Speed * 1
            }
        }
    } else {
    	
    }
}
function ShowLevelImages () {
    if (GamePlaying == 0 && NumberOfLevelMapSprites == 0) {
        LevelImageSprite = sprites.create(LevelImages[LevelNumberSlectorIsOn], SpriteKind.Display)
        NumberOfLevelMapSprites += 1
    }
    if (PreviousNumberLevelSelectorWasOn != LevelNumberSlectorIsOn) {
        PreviousNumberLevelSelectorWasOn = LevelNumberSlectorIsOn
        NumberOfLevelMapSprites = 0
        LevelImageSprite.setFlag(SpriteFlag.StayInScreen, false)
        LevelImageSprite.setPosition(300, 0)
        LevelImageSprite.destroy(effects.ashes, 10)
    }
}
