function StartGameMakeCoinBar () {
    if (controller.A.isPressed() && GamePlaying == 0) {
        LevelImageSprite.setPosition(300, 0)
        LevelImageSprite.destroy(effects.ashes, 10)
        Make_Levels(LevelNumberSlectorIsOn)
        GamePlaying = 1
    }
    if (controller.A.isPressed() && GamePlaying == 1 && IsTimerStarted == 0) {
        CoinBar = image.create(160, 120)
        CoinBar.fillRect(40, 10, 120, 4, 5)
        pause(100)
        if (controller.A.isPressed() && GamePlaying == 1 && IsTimerStarted == 0) {
            IsTimerStarted = 10
            TimerValue = 0
        }
    }
}
